userDefinedLinkHintCss:
.vimiumReset,
div.vimiumReset,
span.vimiumReset,
table.vimiumReset,
a.vimiumReset,
a:visited.vimiumReset,
a:link.vimiumReset,
a:hover.vimiumReset,
td.vimiumReset,
tr.vimiumReset {
    font-family: -apple-system, BlinkMacSystemFont, 'Helvetica Neue', HelveticaNeue, sans-serif;
}


div > .vimiumHintMarker {
    /* linkhint boxes */
    background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#FFF785),
                                 color-stop(100%,#FFC542));
    border: 1px solid #E3BE23;
}

div > .vimiumHintMarker span {
    /* linkhint text */
    color: black;
    font-weight: bold;
    font-size: 12px;
}

div > .vimiumHintMarker > .matchingCharacter {
}


#vomnibar {
    border-radius: 0;
    border: 0;
    box-shadow: 0 2px 16px rgba(0,0,0,0.3);
    color: #2d2d2d;
    left: 50%;
    margin-left: -320px;
    max-width: 640px;
    top: 18px;
}

#vomnibar .vomnibarSearchArea {
    background: #F9FAF9;
    border: 0;
    border-radius: 0;
    padding: 0;
}

#vomnibar input {
    border-radius: 0;
    border: 0;
    box-shadow: none;
    font-size: 24px;
    height: initial;
    padding: 16px 24px;
}

#vomnibar ul {
    background: #F4F3F4;
    border-radius: 0;
    padding: 0;
}

#vomnibar li {
    border: 0;
    color: #2d2d2d;
    display: flex;
    line-height: 1;
    padding: 4px 16px 4px 24px;
}

#vomnibar li:first-of-type {
    border-top: 1px solid #3175ce;
}

#vomnibar li .vomnibarTopHalf,
#vomnibar li .vomnibarBottomHalf {
    flex: 1 0 0;
    font-size: 13px;
    margin: 0;
    overflow: hidden;
    padding: 0;
    text-overflow: ellipsis;
}

#vomnibar li .vomnibarNoInsertText {
    display: none;
}

#vomnibar li .vomnibarSource {
    display: none;
}

#vomnibar li .vomnibarTitle,
#vomnibar li .vomnibarUrl {
    line-height: 1.6;
}

#vomnibar li .vomnibarTitle {
    color: #2d2d2d;
    margin: 0;
    white-space: nowrap;
}

#vomnibar li .vomnibarUrl {
    color: #979797;
}

#vomnibar li .vomnibarMatch {
    color: inherit;
}

#vomnibar li.vomnibarSelected {
    background: #0b56cd;
}

#vomnibar li.vomnibarSelected .vomnibarTitle {
    color: #f4f3f4;
}

#vomnibar li.vomnibarSelected .vomnibarUrl {
    color: #689cde;
}

#vomnibar li.vomnibarSelected .vomnibarMatch {
    color: inherit;
}
